import React from "react"

class User extends React.Component {
    render() {
        return (
            <div className='user' key={el.id}>
                <h3>{el.firstname} {el.surname}</h3>
                <p>{el.bio}</p>
                <b>{el.isHappy ? "Happy!" : "Not happy :("}</b>
            </div>
        )
    }
}

export default User
